Tom Pendergast, Sara Pendergast, &quot;St. James Encyclopedia of Popular Culture, Volume 2&quot;
2000 | pages: 612 | ISBN: 1558624023 | PDF | 18,6 mb

This encyclopedia focuses on American popular culture, examining the post- World War II era in over 2700 alphabetical essays in the following broad categories: film, music, print culture, social life, sports, television and radio, and art and performance. It contains both descriptive essays (75-150 words) and more in-depth essays (up to 3000 words), each signed and concluding with a secondary bibliography.
